import React from "react";

const SecretPage = ({ isLoggedIn }) => {

    if (isLoggedIn) {
        return (
            <div className="secret">
                <h3>This is is full of secrets!!!</h3>
            </div>
        );
    }

    return <p>You should not see this!!!</p>
};

export default SecretPage;
